import React , {useState, useEffect} from "react";
import { centerExamSessionForResultsQuery } from "../../queries&Mutations&Functions/Queries";
import RegistrationDetails from './RegistrationDetails'
import Error from "../../ErrorMessage";

import { Formik, Form } from "formik";
import { Grid, Typography, Paper, Button } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { useApolloClient } from "@apollo/react-hooks";



const useStyles = makeStyles({
  divStyled: {
    display: "grid",
    placeItems: "center",
    top: "2rem",
    height: "90vh",
  },
  pageStyled: {
    display: "grid",
    placeItems: "center",
    marginTop: "2rem",
    padding: "1rem",
    minWidth: "50%",
  },

  titleStyled: {
    display: "grid",
    placeItems: "center",
  },

  partTwo: {
    display: "grid",
    gridTemplateRows: "1fr 1fr ",
  },

  picStyled: {
    // paddingLeft: "1rem",
    height: "15rem",
    width: "12rem",
    display: "grid",
    placeItems: "center",
    borderRadius: "0.5rem",
  },

  centerAll: {
    display: "grid",
    placeItems: "center",
    minWidth: "50%",
  },
});

const CenterRegistrationDetails =({id})=> {
    // static propTypes = { id: PropTypes.string.isRequired };
const client = useApolloClient()
const classes= useStyles()
const [registrationInfo, setRegistrationInfo] = useState({
    center:"", exam:"", session:"", registration:[]
})


const initialValues ={}

const loadCenterRegistrationInfo=async()=>{
    const { data} = await client.query({
query:centerExamSessionForResultsQuery,
variables:{id}

    })

    const getCenterExamSession  = data.centerExamSession 
                    const {  registration, center,examSession } = getCenterExamSession
                    const { exam, session } = { ...examSession }

    setRegistrationInfo((prev)=>({...prev,center, registration,exam,session }))
}

        useEffect(()=>{
        loadCenterRegistrationInfo()
        },[])
const { center, session, exam, registration } =registrationInfo

                    return (


 <Formik initialValues={initialValues}>
      {({ values, isSubmitting }) => (
        <div className={classes.centerAll}>
          <Paper className={classes.pageStyled} elevation={13}>
            <Form aria-busy={isSubmitting}>
              <Grid className={classes.centerAll} container>
                <Grid container className={classes.centerAll}>
                  <Grid item>
                    <Typography
                      className={classes.titleStyled}
                      color="primary"
                      gutterBottom
                      variant="h5"
                      component="h6"
                    >
                      Resultats Complets Du: {exam && exam.examName}, Session: {session && session.sessionName}, centre: {center && center.centerCode}
                    </Typography>
                  </Grid>
                </Grid>
                <Grid container spacing={5}>
                        <Grid item xs={12} sm={6}>

                                        
                                            <strong> Examen: </strong><span>{exam && exam.examName}</span>
                                        
                                            <strong> Centre: </strong><span>{center && center.centerName}</span>
                                        
                                            <strong> Session:</strong><span>{session && session.sessionName}</span>
                           </Grid>
                                  
                                <Grid item xs={12} sm={6}>


                                    {
                                        registration && registration.map((item) => (
                                            <RegistrationDetails key={item.id} registration={item} />
                                        ))
                                    }
                                 </Grid>
                        </Grid>
                </Grid>
            </Form>
          </Paper>
          </div>
            )}
    </Formik>
        );
               
}

export default CenterRegistrationDetails;
